import React from "react";

export default function WorkCard(props){
    return(
        <div className="work-box">
            <a id="work-img-area" href={props.item.url} data-aos><img id="work-img" src={`../${props.item.thumbnail}`} alt="" /></a>
            <div id="work-detail">
                <a id="work-heading-area" href={props.item.url}><h3 id="work-heading">{props.item.title}</h3></a>
                <p id="work-desc">{props.item.desc}</p>
            </div>
        </div>
    )
}
